import './App.css';
 class App extends Component {
    double=(par)=>{
    return Math.pow(par,2);
  }
  render() {
    return (
      <div>
        <h2>
          le deuble est: {this.name(25)}
        </h2>
      </div>
    )
  }
}
export default App;











